pragma solidity 0.6.12;

import {GenNFT} from "./GenNFT.sol";
import './interfaces/IGenNFTFactory.sol';

contract GenNFTFactory is IGenNFTFactory {

    address[] public override genNFT;

    mapping(address => uint) public override getGenNFT;

    event NFTCreated(address indexed caller, address indexed genNFT);

    function genNFTLength() external override view returns (uint) {
        return genNFT.length;
    }

    function createGenNFT(
        string memory _name,
        string memory _symbol,
        string memory _uri
    )  external override returns (address) {

        //address issuer = msg.sender;
        GenNFT gd = new GenNFT(_name, _symbol, _uri, this, msg.sender);
        // Populate mapping
        getGenNFT[address(gd)] = genNFT.length;
        // Add to list
        genNFT.push(address(gd));
        emit NFTCreated(msg.sender, address(gd));

        return address(gd);
    }

}
